import 'dart:async';
import 'dart:convert';
import 'dart:io';
import 'dart:typed_data';

import 'package:dugasta/presentation/utils/custom_button.dart';
import 'package:flutter/material.dart';
import 'package:flutter_pdfview/flutter_pdfview.dart';
import 'package:path_provider/path_provider.dart';

class PaySlipViewPage extends StatefulWidget {
  const PaySlipViewPage({super.key});

  @override
  State<PaySlipViewPage> createState() => _PaySlipViewPageState();
}

class _PaySlipViewPageState extends State<PaySlipViewPage> {
  int? pages = 0;
  int? currentPage = 0;
  bool isReady = false;
  String errorMessage = '';
  String pathPDF = "";
  final Completer<PDFViewController> _controller =
      Completer<PDFViewController>();
  bool loading = false;
  @override
  void initState() {
    super.initState();
  }

  @override
  Widget build(BuildContext context) {
    return SafeArea(
        child: Scaffold(
      body: Column(
        children: [
          SizedBox(
            height: 100,
            width: 100,
            child: Center(
              child: SizedBox(
                width: MediaQuery.of(context).size.width / 1.5,
                child: CustomButton(
                    onPressed: () {
                      _createFileFromString();
                    },
                    name: "View Pdf",
                    circularvalue: 30),
              ),
            ),
          ),
          Expanded(
            flex: 9,
            child: pathPDF.isNotEmpty
                ? PDFView(
                    filePath: pathPDF,
                    enableSwipe: true,
                    swipeHorizontal: true,
                    autoSpacing: false,
                    pageFling: false,
                    onRender: (pages) {
                      setState(() {
                        pages = pages;
                        isReady = true;
                      });
                    },
                    onError: (error) {
                      print(error.toString());
                    },
                    onPageError: (page, error) {
                      print('$page: ${error.toString()}');
                    },
                    onViewCreated: (PDFViewController pdfViewController) {
                      _controller.complete(pdfViewController);
                    },
                    onPageChanged: (page, total) {
                      print('page change: $page/$total');
                    },
                  )
                : Center(
                    child: Text('No Pdf Found!'),
                  ),
          ),
        ],
      ),
    ));
  }

  Future<String> _createFileFromString() async {
    const encodedStr =
        "";
    Uint8List bytes = base64.decode(encodedStr);
    String dir = (await getDownloadsDirectory())!.path;
    File file = File("$dir/${DateTime.now().millisecondsSinceEpoch}.pdf");
    await file.writeAsBytes(bytes);
    print(file.path);

    setState(() {
      pathPDF = file.path;
    });
    print('');
    return file.path;
  }
}
